 Sure, here is a function that will sort an array of strings in alphabetical order using the built-in `sort()` method in JavaScript:

```javascript
function sortStrings(arr) {
  arr.sort();
}
```

You can use this function by passing your array as an argument to it like this:

```javascript
let names = ['John', 'Mary', 'David', 'Alice'];
sortStrings(names);
console.log(names); // Outputs: ["Alice", "David", "John", "Mary"]
``` 

Note that the `sort()` method sorts in place, so this function modifies the original array rather than creating a new one. If you need to create a new sorted array without modifying the original one, you can use the `slice()` and `splice()` methods instead of `sort()`.


Imagine that you are a Business Intelligence Analyst working for a large company with multiple departments. Your boss has assigned you to organize all department names in alphabetical order using an array of strings: ['Sales', 'Finance', 'Marketing', 'Human Resources', 'IT']. 

However, the catch is that your boss wants you to do this without modifying the original list (just like our sorting function does). Therefore, you should create a new sorted list while leaving the original one intact. Additionally, your boss has added an extra requirement: he also asks you to arrange department names starting with a vowel in alphabetical order and those starting with a consonant in reverse alphabetical order within their respective groups (vowels and consonants).

Question: What would be the output of the sorted department list according to these rules?


Firstly, split the department names into two lists depending on whether they start with a vowel or a consonant. Here's how you can do it using JavaScript:
```javascript
let departments = ['Sales', 'Finance', 'Marketing', 'Human Resources', 'IT'];
let vowels = [...new Set(departments) 
              .filter(name => new RegExp('[aeiou]').test(name))].sort();
let consonants = departments.filter(name => !new RegExp('[aeiou]').test(name)).sort().reverse();
```
This will give us two lists: 
- vowels: ['Marketing', 'Human Resources']
- consonants: ['Sales', 'Finance', 'IT']

Next, sort the vowel and consonant departments in alphabetical order. Here's how to do it:
```javascript
vowels.sort();
consonants.sort().reverse();
```
The sorted lists will look like this:
- vowels: ['Human Resources', 'Marketing']
- consonants: ['Sales', 'Finance', 'IT']
Finally, we combine these two sorted lists to get the final result according to our boss's requirements.
```javascript
let sortedDepartments = vowels.concat(consonants);
console.log(sortedDepartments); // Outputs: ["Human Resources", "Marketing", "Sales", "Finance", "IT"]
``` 
Answer: The output of the sorted department list according to your boss's requirements is ['Human Resources', 'Marketing', 'Sales', 'Finance', 'IT'].

